import React from 'react';

import Entries from './entries';
import Users from './users';

const Profile = () => {
    return (
        <div className="profile-container">
            <div className="row header"></div>
            <div className="navbar-options row">
                <div className="col-sm-6">Administrar registros</div>
                <div className="col-sm-6">Administrar usuarios</div>
            </div>
            <div className="data-container" data-holds="">
                <Entries show={true} />
                <Users show={false} />

            </div>
        </div>
    )
}

export default Profile;
